{
  on : {
    init : function(event){
      var target = event.target;
      event.target.getCurrentProjects(function(projects){
        var polygons = [];
        var markers = [];
        var finish = function(){
          console.log("finished!!");
        }
        var loopProject = function(index, project, callback){
          target.getSignalShipInfo(index, function(shipInfos){
            var loopShipInfos = function(shipInfo){
              console.log(shipInfo);
              var width = shipInfo.width / 30000;
              var length = shipInfo.length / 30000;
              var traiWidth = .2;
              var trailLength = .1;
              var headWidth = .8
              var headLength = .2;
              var polygon = {
                id : project.id,
                lng : shipInfo.lon,
                lat : shipInfo.lat,
                rotate : shipInfo.cog / 100,
                path : target.createShipShape(width, length, traiWidth, trailLength, headWidth, headLength),
                infoWindow : {
                  html : target.createInfoHtml({
                    label : shipInfo.name,
                    content : [{
                      label : "船宽",
                      value : shipInfo.width + "米"
                    },{
                      label : "船长",
                      value : shipInfo.length + "米"
                    },{
                      label : "船首角度",
                      value : shipInfo.hdg / 100 + "度"
                    },{
                      label : "吃水深度",
                      value : shipInfo.draught + "米"
                    },{
                      label : "航向",
                      value : shipInfo.cog / 100 + "米"
                    }]
                  })
                },
                rotation : 0,
                minZoom : 11,
                maxZoom : 19,
                on : {
                  click : function(){
                    console.log(project);
                  }
                }
              };
              var marker = {
                id : project.id,
                lng : shipInfo.lon,
                lat : shipInfo.lat,
                symbol : {
                  normal : {
                    rotate : shipInfo.cog / 100,
                    path : []
                  },
                  highlight : {
                    rotate : shipInfo.cog / 100,
                    path : []
                  }
                },
                infoWindow : {
                  html : target.createInfoHtml({
                    label : shipInfo.name,
                    content : [{
                      label : "船宽",
                      value : shipInfo.width + "米"
                    },{
                      label : "船长",
                      value : shipInfo.length + "米"
                    },{
                      label : "船首角度",
                      value : shipInfo.hdg / 100 + "度"
                    },{
                      label : "吃水深度",
                      value : shipInfo.draught + "米"
                    },{
                      label : "航向",
                      value : shipInfo.cog / 100 + "米"
                    }]
                  })
                },
                rotation : 0,
                minZoom : 0,
                maxZoom : 11,
                on : {
                  click : function(){
                    var lng = shipInfo.lon;
                    var lat = shipInfo.lat;
                    target.setZoom(12);
                    target.setCenter([lng,lat]);
                    console.log(shipInfo, lat, lng);
                  }
                }
              }
              markers.push(marker);
              polygons.push(polygon);
            };
            for(var i in shipInfos){
              loopShipInfos(shipInfos[i]);
            }
            callback();
          })
        };
        event.target.asyncRepeat.call(projects, loopProject, finish)
        event.target.render({
          center : [116.404, 33.915],
          polygons : polygons,
          markers : markers,
          zoom : 6
        });
      })
    },
    highlight : function(event){
      console.log("highlight", event);
      var projectId = event.params.project.id;
      event.target.setHighlightByMakerId(projectId);
    }
  }
}
